import React from "react";
import { BrowserRouter, Redirect, Route, Switch } from "react-router-dom";

import './App.css';

function App() {
  return (
      <BrowserRouter>
        <Switch>
            <Route exact path={"/pocetnaStranaAdmina"}>
                <PocetnaStranaAdmin />
            </Route>
            <Route>
                <Redirect to={"/pocetnaStranaAdmina"} />
            </Route>
        </Switch>
      </BrowserRouter>
  );
}

export default App;
